import React from 'react';
import { motion } from 'framer-motion';
import HeaderLinks from './HeaderLinks';
import Logo from './assets/mgilogo.png';
import 'bootstrap/dist/js/bootstrap.bundle.min.js';


function Header() {
  return (
    <motion.nav
      initial={{ y: -250 }}
      animate={{ y: 0 }}
      transition={{ type: 'spring', stiffness: 120 }}
      className="App-header navbar navbar-expand-lg navbar-light bg-light"
    >
      {/* Wrap logo and site title in a container for better alignment with Bootstrap navbar */}
      <div className="navbar-brand" style={{ display: 'flex', alignItems: 'center' }}>
        <img src={Logo} alt="Logo" style={{ height: '50px', marginRight: '10px' }} />
        <h1 style={{ margin: 0 }}>My Website</h1>
      </div>
      {/* Place HeaderLinks component directly without wrapper to align with Bootstrap's responsive navbar */}
      <HeaderLinks />
    </motion.nav>
  );
}

export default Header;
